import React from "react";
import Loading from "../LoadingError/Loading";
import Message from "../LoadingError/Error";
//import { Link } from "react-router-dom";
import moment from "moment";
import "./../../Styles/components/homeTabs.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faCircleChevronRight,
  faChevronRight,
  faArrowDownLong,
} from "@fortawesome/free-solid-svg-icons";
import { useSelector } from "react-redux";

const HomeTabs = () => {
  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;
  const transactionListMy = useSelector((state) => state.transactionListMy);
  const { loading, error, transactions } = transactionListMy;

  useEffect(() => {
    dispatch(listMyTransactions());
    dispatch(getUserDetails("profile"));
  }, [dispatch]);

  return (
    <div className=" d-flex justify-content-center align-items-center flex-column">
      {loading ? (
        <Loading />
      ) : error ? (
        <Message variant="alert-danger">{error}</Message>
      ) : (
        <>
          <div className="container mt-5">
            <div className="row align-items-start mb-5">
              <div className="col-5 account">
                <p className="acc-title">Citizen current account</p>
                <p className="acc-num">
                  account number: {userInfo.accountNumber}
                </p>
              </div>
              <div className="col-6">
                <div className="balance-widget">
                  <p className="available-balance">
                    <span>available balance:</span>
                    <br />${userInfo.balance + 1000}
                  </p>

                  <p className="current-balance">
                    <span>Balance:</span>
                    <br />${userInfo.balance}
                  </p>
                </div>
              </div>
              <div className="col-1">
                <a href="/">
                  <FontAwesomeIcon
                    className="bnt-details"
                    icon={faCircleChevronRight}
                  ></FontAwesomeIcon>
                </a>
              </div>
            </div>
            <div className="costum-table">
              <div className="table-header row">
                <div className="col-2">
                  <p className="sorter-date">
                    Date
                    <FontAwesomeIcon
                      className="icon"
                      icon={faCircleChevronRight}
                    ></FontAwesomeIcon>
                  </p>
                </div>
                <div className="col-8">
                  <p>Description</p>
                </div>
                <div className="col-2">
                  <p className="sorter-date">
                    Amount
                    <FontAwesomeIcon
                      className="icon"
                      icon={faCircleChevronRight}
                    ></FontAwesomeIcon>
                  </p>
                </div>
              </div>
              {transactions.length === 0 ? (
                <div className="row alert alert-info text-center">
                  No transactions
                </div>
              ) : (
                <>
                  {transactions.map((transaction, index) => (
                    <div className="table-row row" key={index}>
                      <div className="col-2 data">
                        <FontAwesomeIcon
                          className="move-down"
                          icon={faArrowDownLong}
                        ></FontAwesomeIcon>
                        <p>
                          {moment(transaction.createdAt).format("MM.DD.YYYY")}
                        </p>
                      </div>
                      <div className="col-7 data">
                        <p>{transaction.purposeOfPayment}</p>
                      </div>
                      <div className="col-2 data amount">
                        <p>${transaction.amount}</p>
                      </div>
                      <div className="col-1 data">
                        <a href="/" className="btn">
                          <FontAwesomeIcon
                            className="bnt-row-details"
                            icon={faChevronRight}
                          ></FontAwesomeIcon>
                        </a>
                      </div>
                    </div>
                  ))}
                </>
              )}
            </div>
            <button
              id="v-pills-list-tab"
              data-bs-toggle="pill"
              data-bs-target="#v-pills-list"
              type="button"
              role="tab"
              aria-controls="v-pills-list"
              aria-selected="false"
            >
              All transactions
            </button>
          </div>
        </>
      )}
    </div>
  );
};

export default HomeTabs;
